const n={},a='<h1 id="popup-dan-chu-ceng" tabindex="-1">Popup 弹出层</h1>\n<p>弹出层容器，用于展示弹窗、信息提示等内容，支持多个弹出层叠加展示。</p>\n<h2 id="ji-chu-yong-fa" tabindex="-1">基础用法</h2>\n<p>通过 <code v-pre>visible</code> 控制弹出层是否显示。</p>\n<pre class="language-tsx"><code class="language-tsx" v-pre><span class="token keyword">import</span> React<span class="token punctuation">,</span> <span class="token punctuation">{</span> useState <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'react\'</span><span class="token punctuation">;</span>\n<span class="token keyword">import</span> <span class="token punctuation">{</span> Popup<span class="token punctuation">,</span> Cell <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'fnx-ui\'</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> <span class="token function-variable function">App</span> <span class="token operator">=</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n  <span class="token keyword">const</span> <span class="token punctuation">[</span>isPopupVisible<span class="token punctuation">,</span> setIsPopupVisible<span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token function">useState</span><span class="token punctuation">(</span><span class="token boolean">false</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n\n  <span class="token keyword">const</span> <span class="token function-variable function">showPopup</span> <span class="token operator">=</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n    <span class="token function">setIsPopupVisible</span><span class="token punctuation">(</span><span class="token boolean">true</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n  <span class="token keyword">const</span> <span class="token function-variable function">handleClose</span> <span class="token operator">=</span> <span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">{</span>\n    <span class="token function">setIsPopupVisible</span><span class="token punctuation">(</span><span class="token boolean">false</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n  <span class="token keyword">return</span> <span class="token punctuation">(</span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n      </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Cell</span></span>\n        <span class="token attr-name">title</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">"</span>Open Popup<span class="token punctuation">"</span></span>\n        <span class="token attr-name">rightIcon</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Icon</span></span> <span class="token attr-name">name</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">"</span>arrow-right<span class="token punctuation">"</span></span> <span class="token punctuation">/></span></span><span class="token punctuation">}</span></span>\n        <span class="token attr-name">onClick</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span>showPopup<span class="token punctuation">}</span></span>\n        <span class="token attr-name">clickable</span>\n      <span class="token punctuation">/></span></span><span class="token plain-text">\n      </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Popup</span></span> <span class="token attr-name">visible</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span>isPopupVisible<span class="token punctuation">}</span></span> <span class="token attr-name">onClose</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span>handleClose<span class="token punctuation">}</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n        Content\n      </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span><span class="token class-name">Popup</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n    </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span></span><span class="token punctuation">></span></span>\n  <span class="token punctuation">)</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">App</span></span> <span class="token punctuation">/></span></span><span class="token punctuation">,</span> mountNode<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n<h2 id="dan-chu-wei-zhi" tabindex="-1">弹出位置</h2>\n<p>通过 <code v-pre>position</code> 属性设置弹出位置，默认居中弹出，可以设置为 <code v-pre>top</code>、<code v-pre>bottom</code>、<code v-pre>left</code>、<code v-pre>right</code> 或 <code v-pre>center</code>。</p>\n<pre class="language-tsx"><code class="language-tsx" v-pre><span class="token keyword">import</span> <span class="token punctuation">{</span> Popup <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'fnx-ui\'</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n    </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Popup</span></span> <span class="token attr-name">visible</span> <span class="token attr-name">position</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">"</span>top<span class="token punctuation">"</span></span> <span class="token attr-name">style</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token punctuation">{</span> height<span class="token operator">:</span> <span class="token string">\'30%\'</span> <span class="token punctuation">}</span><span class="token punctuation">}</span></span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span><span class="token class-name">Popup</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n  </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span></span><span class="token punctuation">></span></span><span class="token punctuation">,</span>\n  mountNode<span class="token punctuation">,</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n<h2 id="yuan-jiao-dan-chuang" tabindex="-1">圆角弹窗</h2>\n<p>设置 <code v-pre>round</code> 属性后，弹窗会根据弹出位置添加不同的圆角样式。</p>\n<pre class="language-tsx"><code class="language-tsx" v-pre><span class="token keyword">import</span> <span class="token punctuation">{</span> Popup <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'fnx-ui\'</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n    </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Popup</span></span> <span class="token attr-name">visible</span> <span class="token attr-name">round</span> <span class="token attr-name">position</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">"</span>bottom<span class="token punctuation">"</span></span> <span class="token attr-name">style</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token punctuation">{</span> height<span class="token operator">:</span> <span class="token string">\'30%\'</span> <span class="token punctuation">}</span><span class="token punctuation">}</span></span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span><span class="token class-name">Popup</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n  </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span></span><span class="token punctuation">></span></span><span class="token punctuation">,</span>\n  mountNode<span class="token punctuation">,</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n<h2 id="zhi-ding-gua-zai-wei-zhi" tabindex="-1">指定挂载位置</h2>\n<p>弹出层可以通过 <code v-pre>mountTo</code> 属性指定挂载位置。</p>\n<pre class="language-tsx"><code class="language-tsx" v-pre><span class="token keyword">import</span> <span class="token punctuation">{</span> Popup <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'fnx-ui\'</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n    </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Popup</span></span> <span class="token attr-name">visible</span> <span class="token attr-name">mountTo</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> document<span class="token punctuation">.</span>body<span class="token punctuation">}</span></span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span><span class="token class-name">Popup</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n    </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Popup</span></span> <span class="token attr-name">visible</span> <span class="token attr-name">mountTo</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token operator">=></span> document<span class="token punctuation">.</span><span class="token function">getElementById</span><span class="token punctuation">(</span><span class="token string">\'app\'</span><span class="token punctuation">)</span><span class="token punctuation">}</span></span><span class="token punctuation">></span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span><span class="token class-name">Popup</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n  </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span></span><span class="token punctuation">></span></span><span class="token punctuation">,</span>\n  mountNode<span class="token punctuation">,</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n<h2 id="shi-yong-popup.select" tabindex="-1">使用 Popup.Select</h2>\n<pre class="language-tsx"><code class="language-tsx" v-pre><span class="token keyword">import</span> <span class="token punctuation">{</span> Popup<span class="token punctuation">,</span> Cell<span class="token punctuation">,</span> Icon<span class="token punctuation">,</span> Picker <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">\'fnx-ui\'</span><span class="token punctuation">;</span>\n\n<span class="token keyword">const</span> options <span class="token operator">=</span> <span class="token punctuation">[</span>\n  <span class="token string">\'Monday\'</span><span class="token punctuation">,</span>\n  <span class="token string">\'Tuesday\'</span><span class="token punctuation">,</span>\n  <span class="token string">\'Wednesday\'</span><span class="token punctuation">,</span>\n  <span class="token string">\'Thursday\'</span><span class="token punctuation">,</span>\n  <span class="token string">\'Friday\'</span><span class="token punctuation">,</span>\n  <span class="token string">\'Saturday\'</span><span class="token punctuation">,</span>\n  <span class="token string">\'Sunday\'</span><span class="token punctuation">,</span>\n<span class="token punctuation">]</span><span class="token punctuation">;</span>\n\nReactDOM<span class="token punctuation">.</span><span class="token function">render</span><span class="token punctuation">(</span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n    &lt;Popup.Select&lt;string>\n      select=</span><span class="token punctuation">{</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Picker</span></span> <span class="token attr-name">data</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span>options<span class="token punctuation">}</span></span> <span class="token attr-name">title</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">"</span>Select date<span class="token punctuation">"</span></span> <span class="token punctuation">/></span></span><span class="token punctuation">}</span><span class="token plain-text">\n    >\n      </span><span class="token punctuation">{</span><span class="token punctuation">(</span>value<span class="token punctuation">)</span> <span class="token operator">=></span> <span class="token punctuation">(</span>\n        <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Cell</span></span>\n          <span class="token attr-name">clickable</span>\n          <span class="token attr-name">title</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span>value <span class="token operator">||</span> <span class="token string">\'Select date\'</span><span class="token punctuation">}</span></span>\n          <span class="token attr-name">rightIcon</span><span class="token script language-javascript"><span class="token script-punctuation punctuation">=</span><span class="token punctuation">{</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span><span class="token class-name">Icon</span></span> <span class="token attr-name">name</span><span class="token attr-value"><span class="token punctuation attr-equals">=</span><span class="token punctuation">"</span>arrow-right<span class="token punctuation">"</span></span> <span class="token punctuation">/></span></span><span class="token punctuation">}</span></span>\n        <span class="token punctuation">/></span></span>\n      <span class="token punctuation">)</span><span class="token punctuation">}</span><span class="token plain-text">\n    </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span><span class="token class-name">Popup.Select</span></span><span class="token punctuation">></span></span><span class="token plain-text">\n  </span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span></span><span class="token punctuation">></span></span><span class="token punctuation">,</span>\n  mountNode<span class="token punctuation">,</span>\n<span class="token punctuation">)</span><span class="token punctuation">;</span>\n</code></pre>\n<h2 id="api" tabindex="-1">API</h2>\n<h3 id="popup-props" tabindex="-1">Popup Props</h3>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n<th>版本</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>visible</td>\n<td>是否显示弹出层</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>false</code></td>\n<td></td>\n</tr>\n<tr>\n<td>renderOnShow</td>\n<td>是否在显示弹层时才渲染节点</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>true</code></td>\n<td></td>\n</tr>\n<tr>\n<td>destroyOnHide</td>\n<td>是否在关闭弹层时销毁节点</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>false</code></td>\n<td></td>\n</tr>\n<tr>\n<td>mountTo</td>\n<td>指定挂载的节点</td>\n<td><code v-pre>HTMLElement</code> | <code v-pre>() =&gt; HTMLElement</code> | <code v-pre>false</code></td>\n<td><code v-pre>() =&gt; document.body</code></td>\n<td></td>\n</tr>\n<tr>\n<td>transitionDuration</td>\n<td>过渡动画时常，单位毫秒</td>\n<td><code v-pre>number</code></td>\n<td><code v-pre>300</code></td>\n<td></td>\n</tr>\n<tr>\n<td>transitionName</td>\n<td>过渡动画类名</td>\n<td><code v-pre>string</code></td>\n<td>-</td>\n<td></td>\n</tr>\n<tr>\n<td>lockScroll</td>\n<td>是否锁定背景滚动</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>true</code></td>\n<td></td>\n</tr>\n<tr>\n<td>position</td>\n<td>遮罩层位置</td>\n<td><code v-pre>\'top\'</code> | <code v-pre>\'bottom\'</code> | <code v-pre>\'left\'</code> | <code v-pre>\'right\'</code> | <code v-pre>\'center\'</code></td>\n<td><code v-pre>\'center\'</code></td>\n<td></td>\n</tr>\n<tr>\n<td>round</td>\n<td>是否展示圆角</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>false</code></td>\n<td></td>\n</tr>\n<tr>\n<td>safeAreaInsetBottom</td>\n<td>是否开启底部安全区适配</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>false</code></td>\n<td></td>\n</tr>\n<tr>\n<td>overlay</td>\n<td>是否显示遮罩层</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>true</code></td>\n<td></td>\n</tr>\n<tr>\n<td>overlayClassName</td>\n<td>遮罩层 Class 类名</td>\n<td><code v-pre>string</code></td>\n<td>-</td>\n<td></td>\n</tr>\n<tr>\n<td>overlayStyle</td>\n<td>遮罩层样式</td>\n<td><code v-pre>CSSProperties</code></td>\n<td>-</td>\n<td></td>\n</tr>\n<tr>\n<td>overlayCloseable</td>\n<td>是否点击遮罩层关闭</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>true</code></td>\n<td></td>\n</tr>\n</tbody>\n</table>\n<p><strong>Popup 默认关闭后状态不会自动清空, 如果希望每次打开都是新内容，请设置 <code v-pre>destroyOnHide</code>。</strong></p>\n<h3 id="popup-events" tabindex="-1">Popup Events</h3>\n<table>\n<thead>\n<tr>\n<th>事件名</th>\n<th>说明</th>\n<th>类型</th>\n<th>版本</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>onOverlayClick</td>\n<td>点击遮罩层触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onClose</td>\n<td>关闭事件触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onBeforeHide</td>\n<td>关闭动画之前触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onHide</td>\n<td>关闭动画时触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onAfterHide</td>\n<td>关闭动画后触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onBeforeShow</td>\n<td>显示动画前触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onShow</td>\n<td>显示动画中触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n<tr>\n<td>onAfterShow</td>\n<td>显示动画后触发</td>\n<td><code v-pre>() =&gt; void</code></td>\n<td></td>\n</tr>\n</tbody>\n</table>\n<h3 id="popup.select-props" tabindex="-1">Popup.Select Props</h3>\n<p>Popup.Select 继承了 Popup 的属性并新增了如下属性：</p>\n<table>\n<thead>\n<tr>\n<th>名称</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n<th>版本</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>disabled</td>\n<td>是否禁用</td>\n<td><code v-pre>boolean</code></td>\n<td><code v-pre>false</code></td>\n<td></td>\n</tr>\n<tr>\n<td>value</td>\n<td>选项值</td>\n<td><code v-pre>any</code></td>\n<td>-</td>\n<td></td>\n</tr>\n<tr>\n<td>defaultValue</td>\n<td>默认选项值</td>\n<td><code v-pre>any</code></td>\n<td>-</td>\n<td></td>\n</tr>\n<tr>\n<td>select</td>\n<td>弹出层内容</td>\n<td><code v-pre>ReactNode</code></td>\n<td>-</td>\n<td></td>\n</tr>\n<tr>\n<td>selectDefaultValuePropName</td>\n<td>默认值名字</td>\n<td><code v-pre>string</code></td>\n<td><code v-pre>defaultValue</code></td>\n<td></td>\n</tr>\n<tr>\n<td>selectConfirmTrigger</td>\n<td>确认事件回调名称</td>\n<td><code v-pre>string</code></td>\n<td><code v-pre>onConfirm</code></td>\n<td></td>\n</tr>\n<tr>\n<td>selectCancelTrigger</td>\n<td>取消事件回调名称</td>\n<td><code v-pre>string</code></td>\n<td><code v-pre>onCancel</code></td>\n<td></td>\n</tr>\n<tr>\n<td>trigger</td>\n<td>子元素触发事件名称</td>\n<td><code v-pre>string</code></td>\n<td><code v-pre>onClick</code></td>\n<td></td>\n</tr>\n<tr>\n<td>children</td>\n<td>子元素</td>\n<td><code v-pre>ReactNode</code> | <code v-pre>(value?: any) =&gt; ReactNode</code></td>\n<td>-</td>\n<td></td>\n</tr>\n</tbody>\n</table>\n<h3 id="popup.select-events" tabindex="-1">Popup.Select Events</h3>\n<p>Popup.Select 继承了 Popup 的事件并新增了如下事件：</p>\n<table>\n<thead>\n<tr>\n<th>事件名</th>\n<th>说明</th>\n<th>类型</th>\n<th>版本</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>onChange</td>\n<td><code v-pre>value</code> 发生改变时触发</td>\n<td><code v-pre>(value: any) =&gt; void</code></td>\n<td></td>\n</tr>\n</tbody>\n</table>\n';export{n as attributes,a as html};
